import React, { Component } from 'react'

export class Users extends Component {
    constructor(){
        super();

    }


    render() {
        return (
            <div>
                {this.state.users.map(user => {
                    <div>
                        {user.login}
                    </div>
                })
                }
            </div>
        )
    }
}

export default Users
